<html lang="en">

  <body>
    <main>
      <iframe src="https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d436236.71104955155!2d120.36410089051758!3d31.32863048508219!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x35b3a0d19bd25e07%3A0x21e57f85bd766004!2sSuzhou%2C%20Jiangsu%2C%20China!5e0!3m2!1sen!2sus!4v1633557027164!5m2!1sen!2sus" width="600" height="450" style="border:0;" allowfullscreen="" loading="lazy"></iframe>
      
      <hr>
      
      <h3>An image by using the object tag</h3>
      <object data="IMG_1081.GIF"></object>
      
      <hr>
      
      <section>
        <h3>A YouTube video that starts from 3:00 and is disabled</h3>
        <iframe width="560" height="315" src="https://www.youtube.com/embed/4mhlzyxLgoI?start=180" title="YouTube video player" frameborder="0" allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture" allowfullscreen disabled></iframe>
        <h3>ANCAPISTAN</h3>
        <video width="560" height="315" controls>
          <source src="ancapistan.mp4" type="video/mp4">
        </video>
        <audio controls>
          <source src="ancapistan.acc" type="audio/acc">
        </audio>
      </section>
    </main>
  </body>
